import scraperwiki
import lxml.html

#    <meta property="og:latitude" content="51.706070" />
 #   <meta property="og:longitude" content="-0.417008" />
  #  <meta property="og:street-address" content="63 High Street  " />
   # <meta property="og:locality" content="Abbots Langley" />
    #<meta property="og:postal-code" content="WD5 0AE" />
    #<meta property="og:country-name" content="UK" />

def scrape_page(url):
    html = scraperwiki.scrape(url)
    root = lxml.html.fromstring(html)
    record = {}
    lat = root.cssselect("meta[property='og:latitude']")
    longitude = root.cssselect("meta[property='og:longitude']")
    street = root.cssselect("meta[property='og:street-address']")
    locality = root.cssselect("meta[property='og:locality']")
    postcode = root.cssselect("meta[property='og:postal-code']")
    country = root.cssselect("meta[property='og:country-name']")
    record['lat'] = lat[0].get('content')
    record['long'] = longitude[0].get('content')
    record['street'] = street[0].get('content')
    record['locality'] = locality[0].get('content')
    record['postcode'] = postcode[0].get('content')
    record['country'] = country[0].get('content')
#    street = root.cssselect("div.info p")
 #   postcode = root.cssselect("div.info p br")
    #if postcode:
#    record['street'] = street[0].text
 #   record['fulladdress'] = street[0].text_content()
  #  record['phone'] = street[1].text
    record['url'] = url
    #    print record
    scraperwiki.sqlite.save(["url"], record)
    

